  path: '/landing',
  name: 'landing',
  component: Landing,
  route: Route
}, {
  path: '/landing-about',
  name: 'About',
  component: About,
  route: Route
}, {
  path: '/landing-blog',
  name: 'Blog',
  component: Blog,
  route: Route
}, {
